import React from 'react';
import { Jumbotron, Container } from 'reactstrap';

const Example = (props) => {
  return (
    <div>
      <Jumbotron fluid>
        <Container fluid>
          <h1 className="display-3">Pick Destination</h1>
          <p className="lead">Click here Add a Destination to start your Trip  </p>
        </Container>
      </Jumbotron>
    </div>
  );
};

export default Example;
